import React from 'react'
import { Link } from 'react-router-dom'
import Slider from 'react-slick';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

export default function Home() {

    const services = [
        { img: require('../Images/service1.jpg'), name: 'Service 1' },
        { img: require('../Images/service2.jpg'), name: 'Service 2' },
        { img: require('../Images/service3.jpg'), name: 'Service 3' }
    ];

    const settings = {
        dots: true,
        infinite: true,
        speed: 100,
        slidesToShow: 1,
        slidesToScroll: 1,
        autoplay: true,
        autoplaySpeed: 1500,
        draggable: true
    };

    return (
        <div className="rout-container">

            <div className="home-container">

                <div className="hero-content">
                    <h4>Welcome to <span className="highlight">Vital Aid</span></h4>
                    <p>
                        WE ARE <br /> <span className="highlight">ALWAYS</span><br />WITH YOU
                    </p>
                    <Link to="/appoinment" className="appointment-btn">
                        Book Appointment
                    </Link>
                </div>

                <div className="slider-container">
                    <Slider {...settings}>
                        {services.map((service, index) => (
                            <div key={index} className="slider-item">
                                <img src={service.img} alt={service.name} />
                                <p>{service.name}</p>
                            </div>
                        ))}
                    </Slider>
                </div>

            </div>

        </div>
    );
}
